export const Register =()=>{
    return (
        <div className="authorize">
            <h1>WebShell</h1>
            <label>Логин</label> <p/>
            <input className="inputAuth"/><p/>
            <label>Пароль</label><p/>
            <input className="inputAuth"/><p/>
            <input className='buttonAuth' type='submit' value='Зарегестрироваться'/>
        </div>
    );
}
